import React from 'react'; // Import the Component component from React

function SlideInfo(props) {
  return(
    <div className='slideInfo' style={{opacity:props.opacity}}>
      <h2>{props.text[0]}</h2>
      <h1>{props.text[1]}</h1>
      <h3>{props.text[2]}</h3>
    </div>
  )
}

export default SlideInfo;
